// import logo from './logo.svg';
// import './App.css';
import React from 'react';

class App extends React.Component {
  constructor() {
    super();
  }

  render() {
    return (
      <div>
        <div>
          <header>
            <p>
              Yummy
            </p>
          </header>
        </div>
        <div>
          <button>
            Create a Group
          </button>
          <button>
            Join a Group
          </button>
        </div>
      </div>
    )
  }
}


export default App;
